import React from 'react';
import './css/middle.css';
import animage from './img/backimg.png';

function Middle(){
    return(
<div>
        <img src={animage} className="App-logo" alt="logo" />
        <div className="App-middle">Monica VO</div>
        </div>
    );
}

export default Middle;
